void SysTick_Init(void){
	NVIC_ST_CTRL_R = 0;    					// disable SysTick during setup
  NVIC_ST_CTRL_R = 0x07;
  NVIC_ST_RELOAD_R = 1000000;			// reload value --> 20 Hz
  NVIC_ST_CURRENT_R = 0;      		// any write to current clears it
}

struct Food {
	uint8_t x;
	uint8_t y;
};

typedef struct Food Food_t;

struct Player	{
	int16_t x;
	int16_t y;
	int16_t xSpeed;
	int16_t ySpeed;
	uint16_t size;
	uint16_t radius;
};

typedef struct Player Player_t;

Player_t Player1;
Player_t Player2;
Food_t Foods[30];

int16_t Squared(int16_t input){
	if(input<0){
		input *= -1;
	}
	input *= input;
	return input;
}
uint32_t data[4];

void SysTick_Handler(void){
	uint8_t i;
	uint32_t distance1;
	uint32_t distance2;
	uint32_t distanceEat1;
	uint32_t distanceEat2;
	for(i=0; i<30; i++){
		distance1 = Squared(Player1.x - Foods[i].x)+Squared(Player1.y - Foods[i].y);
		distance2 = Squared(Foods[i].x - Player2.x)+Squared(Foods[i].y - Player2.y);
		distanceEat1 = Squared(Player1.radius)+36;
		distanceEat2 = Squared(Player2.radius)+36;
		if((distance1<distanceEat1)&(distance2<distanceEat2)){
			//food is eaten *om nom*
			if(distance1<distance2){
				//Player 1 gets to eat
				Player1.size ++;    //size increases
				Player1.radius ++;
			}else{
				//Player 2 gets to eat
				Player2.size ++;   //size increase
				Player2.radius ++;
			}
			ST7735_DrawBitmap(Foods[i].x-2, Foods[i].y+2, FoodGone, 4, 4);
			Foods[i].x = Random()%123+2;  //sets x-value of center to random value between 2 and 125
			Foods[i].y = Random()%151+2;  //sets y-value of center to random value between 2 and 153
			ST7735_DrawBitmap(Foods[i].x-2, Foods[i].y+2, Food, 4, 4); //prints at bottom left corner
		}else if(distance1<distanceEat1){
			//Player 1 gets to eat
			Player1.size ++;
			Player1.radius ++;
			ST7735_DrawBitmap(Foods[i].x-2, Foods[i].y+2, FoodGone, 4, 4);
			Foods[i].x = Random()%123+2;  //sets x-value of center to random value between 2 and 125
			Foods[i].y = Random()%151+2;  //sets y-value of center to random value between 2 and 153
			ST7735_DrawBitmap(Foods[i].x-2, Foods[i].y+2, Food, 4, 4); //prints at bottom left corner
		}else if(distance2<distanceEat2){
			//Player 2 get to eat
			Player2.size ++;
			Player2.radius ++;
			ST7735_DrawBitmap(Foods[i].x-2, Foods[i].y+2, FoodGone, 4, 4);
			Foods[i].x = Random()%123+2;  //sets x-value of center to random value between 2 and 125
			Foods[i].y = Random()%151+2;  //sets y-value of center to random value between 2 and 153
			ST7735_DrawBitmap(Foods[i].x-2, Foods[i].y+2, Food, 4, 4); //prints at bottom left corner
		}
	}
	ADC_In(data);
	Player1.xSpeed = (data[0] - 1892)/1024;
	Player1.ySpeed = (data[1] - 1892)/1024;
	Player2.xSpeed = -(data[2] - 1892)/1024;
	Player2.ySpeed = (data[3] - 1892)/1024;
	if(((Player1.x + Player1.xSpeed)>(127-Player1.radius))|((Player1.x + Player1.xSpeed)<Player1.radius)){
		Player1.xSpeed = 0;
	}
	if(((Player1.y + Player1.ySpeed)>(155-Player1.radius))|((Player1.y + Player1.ySpeed)<Player1.radius)){
		Player1.ySpeed = 0;
	}
	if(((Player2.x + Player2.xSpeed)>(127-Player2.radius))|((Player2.x + Player2.xSpeed)<Player2.radius)){
		Player2.xSpeed = 0;
	}
	if(((Player2.y + Player2.ySpeed)>(155-Player2.radius))|((Player2.y + Player2.ySpeed)<Player2.radius)){
		Player2.ySpeed = 0;
	}
	Player1.x = Player1.x + Player1.xSpeed;
	Player1.y = Player1.y + Player1.ySpeed;
	Player2.x = Player2.x + Player2.xSpeed;
	Player2.y = Player2.y + Player2.ySpeed;
	
	DistanceBtwn = Squared(Player1.x -Player2.x) + Squared(Player1.y - Player2.y);
	DistanceFight = Squared(Player1.radius + Player2.radius);
	
	
}

int main(void){
	DisableInterrupts();
  TExaS_Init();  // set system clock to 80 MHz
  Random_Init(NVIC_ST_CURRENT_R);
	ADC_Init();
	SysTick_Init();
  Output_Init();
  ST7735_FillScreen(0x0000);            // set screen to black
	for(FoodCount=0; FoodCount<60; FoodCount++){
		Foods[FoodCount].x = Random()%123+2;  //sets x-value of center to random value between 2 and 125
		Foods[FoodCount].y = Random()%151+2;	//sets y-value of center to random value between 2 and 153
		ST7735_DrawBitmap(Foods[FoodCount].x-2, Foods[FoodCount].y+2, Food, 4, 4); //prints at bottom left corner		
	}
	Player1.x = 32;
	Player1.y = 78;
	Player1.xSpeed = 0;
	Player1.ySpeed = 0;
	Player1.size = 0;
	Player1.radius = 4;
	ST7735_DrawBitmap(Player1.x-Player1.radius, Player1.y+Player1.radius, Char1_1, 2*Player1.radius, 2*Player1.radius);
	Player2.x = 96;
	Player2.y = 78;
	Player2.xSpeed = 0;
	Player2.ySpeed = 0;
	Player2.size = 0;
	Player2.radius = 4;
	ST7735_DrawBitmap(Player2.x-Player2.radius, Player2.y+Player2.radius, Char2_1, 2*Player2.radius, 2*Player2.radius);
  //Delay100ms(50);              // delay 5 sec at 80 MHz
	EnableInterrupts();
	while(1){
		int8_t i;
		volatile uint32_t check;
		DisableInterrupts();
	  ST7735_DrawBitmap(Player1.x-Player1.radius, Player1.y+Player1.radius, Sprite1[Player1.size], 2*Player1.radius, 2*Player1.radius);	
		if(Player1.xSpeed>0){
			for(i=1; i <= Player1.xSpeed; i++){
				ST7735_DrawFastVLine(Player1.x-Player1.radius-i, Player1.y-Player1.radius, 2*Player1.radius , 0x0000);
			}
		}else if(Player1.xSpeed<0){
			for(i=0; i > Player1.xSpeed; i--){
				ST7735_DrawFastVLine(Player1.x+Player1.radius-i, Player1.y-Player1.radius, 2*Player1.radius , 0x0000);
			}
		}
		if(Player1.ySpeed>0){
			for(i=0; i < Player1.ySpeed; i++){
				ST7735_DrawFastHLine(Player1.x-Player1.radius, Player1.y-Player1.radius-i, 2*Player1.radius , 0x0000);
			}
		}else if(Player1.ySpeed<0){
			for(i=-1; i >= Player1.ySpeed; i--){
				ST7735_DrawFastHLine(Player1.x-Player1.radius, Player1.y+Player1.radius-i, 2*Player1.radius , 0x0000);
			}
		}
		EnableInterrupts();
		DisableInterrupts();
		ST7735_DrawBitmap(Player2.x-Player2.radius, Player2.y+Player2.radius, Sprite2[Player2.size], 2*Player2.radius, 2*Player2.radius);
		if(Player2.xSpeed>0){
			for(i=1; i <= Player2.xSpeed; i++){
				ST7735_DrawFastVLine(Player2.x-Player2.radius-i, Player2.y-Player2.radius, 2*Player2.radius , 0x0000);
			}
		}else if(Player2.xSpeed<0){
			for(i=0; i > Player2.xSpeed; i--){
				ST7735_DrawFastVLine(Player2.x+Player2.radius+i, Player2.y-Player2.radius, 2*Player2.radius , 0x0000);
			}
		}
		if(Player2.ySpeed>0){
			for(i=0; i < Player2.ySpeed; i++){
				ST7735_DrawFastHLine(Player2.x-Player2.radius, Player2.y-Player2.radius-i, 2*Player2.radius , 0x0000);
			}
		}else if(Player2.ySpeed<0){
			for(i=-1; i >= Player2.ySpeed; i--){
				ST7735_DrawFastHLine(Player2.x-Player2.radius, Player2.y+Player2.radius-i, 2*Player2.radius , 0x0000);
			}
		}
		EnableInterrupts();
		
		if(DistanceBtwn < DistanceFight){
			DisableInterrupts();
			if(Player1.size > Player2.size){
				ST7735_FillScreen(0x0000);
				ST7735_SetCursor(30, 90);
				ST7735_OutString("Player 1 Wins!");
				while(1){}
			} else if(Player1.size < Player2.size){
				ST7735_FillScreen(0x0000);
				ST7735_SetCursor(30, 90);
				ST7735_OutString("Player 2 Wins!");
				while(1){}
			}
		}
	}
}




// You can use this timer only if you learn how it works


void Delay100ms(uint32_t count){
	uint32_t volatile time;
  while(count>0){
    time = 727240;  // 0.1sec at 80 MHz
    while(time){
	  	time--;
    }
    count--;
  }
}
